async function startFancyboxOutlets(){const t=document.querySelectorAll(".js-fancybox-outlets"),a=await getGalleryImages();t.forEach((t,e)=>{t.addEventListener("click",t=>{t.preventDefault();const e=t.target.parentNode.dataset.fancyboxId;$.fancybox.open(a).jumpTo(e)})})}async function getGalleryImages(){let t=await fetch("http://vasilisa.bitrix.mobi/ajax/load_gallery.php");if(t.ok){return await t.json()}{const a=new Error("HTTP error: "+t.status);return void console.error(a)}}startFancyboxOutlets();